import React from "react";
import "./Inventory.css";

const Inventory = () => {
  // Updated inventory data
  const inventory = [
    {
      category: "Fruits",
      items: [
        { name: "Apple", quantity: "3", expiry: "2025-01-13" },
        { name: "Banana", quantity: "2", expiry: "2025-01-03" },
      ],
    },
    {
      category: "Vegetables",
      items: [
        { name: "Tomato", quantity: "5", expiry: "2025-01-09" },
        { name: "Onion", quantity: "2", expiry: "2025-02-14" },
      ],
    },
    {
      category: "Dairy",
      items: [],  // Empty category
    },
    {
      category: "Others",
      items: [],  // Empty category
    },
  ];

  return (
    <div className="inventory-container">
      <div className="inventory-header">
        <h1>INVENTORY</h1>
      </div>
      <div className="inventory-content">
        <div className="inventory-data">
          {inventory.map((category, index) => (
            <div key={index} className="inventory-category">
              <h2>{category.category}:</h2>
              {category.items.length > 0 ? (
                <ul>
                  {category.items.map((item, index) => (
                    <li key={index}>
                      {item.name}: {item.quantity} (Expiration: {item.expiry})
                    </li>
                  ))}
                </ul>
              ) : (
                <p>[empty]</p>
              )}
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Inventory;
